<?php/** * Created by PhpStorm. * User: khaoula * Date: 1/15/2023 * Time: 12:14 AM */namespace App\Document;use Doctrine\ODM\MongoDB\Mapping\Annotations as ODM;/** @ODM\Document */class PetParent extends User{    /** @ODM\EmbedOne(targetDocument=Pet::class) */    private $pet;    /** @ODM\ReferenceMany(targetDocument=adoptionoffer::class) */    private $adoptionoffer;    /**     * @return mixed     */    public function getPet()    {        return $this->pet;    }    /**     * @param mixed $pet     */    public function setPet($pet): void    {        $this->pet = $pet;    }    /**     * @return mixed     */    public function getAdoptionoffer()    {        return $this->adoptionoffer;    }    /**     * @param mixed $adoptionoffer     */    public function setAdoptionoffer($adoptionoffer): void    {        $this->adoptionoffer = $adoptionoffer;    }}